import React from "react";

const TodoItem = ({ todo }) => {
  return (
    <div className="bg-gray-900 h-screen">
      Home
      {todos.map((todo) => (
        <div>{todo.title}</div>
      ))}
    </div>
  );
};
export default TodoItem;
